ssize_t
MHD_send_data_ (struct MHD_Connection *connection,
                const char *buffer,
                size_t buffer_size,
                bool push_data)
{
  MHD_socket s = connection->socket_fd;
  ssize_t ret;
#ifdef HTTPS_SUPPORT
  const bool tls_conn = (connection->daemon->options & MHD_USE_TLS);
#else  /* ! HTTPS_SUPPORT */
  const bool tls_conn = false;
#endif /* ! HTTPS_SUPPORT */

  /* Log entry and key state: whether socket is invalid, connection state,
   * tls_conn (this is the central value for the reported unreachable code),
   * buffer_size and push_data. */
  {
    FILE *log = fopen("/tmp/logs/1796.txt", "a");
    if (log)
    {
      fprintf(log, "ENTER MHD_send_data_: s_is_invalid=%d, state=%d, tls_conn=%d, buffer_size=%zu, push_data=%d\n",
              (int)(s == MHD_INVALID_SOCKET), (int) connection->state, (int) tls_conn, buffer_size, (int) push_data);
      fclose(log);
    }
  }

  if ( (MHD_INVALID_SOCKET == s) ||
       (MHD_CONNECTION_CLOSED == connection->state) )
  {
    FILE *log = fopen("/tmp/logs/1796.txt", "a");
    if (log)
    {
      fprintf(log, "EARLY RETURN: NOTCONN (invalid socket or closed). s_is_invalid=%d, state=%d\n",
              (int)(s == MHD_INVALID_SOCKET), (int) connection->state);
      fclose(log);
    }
    return MHD_ERR_NOTCONN_;
  }

  if (buffer_size > SSIZE_MAX)
  {
    FILE *log = fopen("/tmp/logs/1796.txt", "a");
    if (log)
    {
      fprintf(log, "Truncating buffer_size from %zu to SSIZE_MAX and clearing push_data (was %d)\n",
              buffer_size, (int) push_data);
      fclose(log);
    }

    buffer_size = SSIZE_MAX; /* Max return value */
    push_data = false; /* Incomplete send */
  }

  /* Log just before evaluating tls_conn-controlled branch so test harness
   * can observe tls_conn value and determine reachability of the TLS branch. */
  {
    FILE *log = fopen("/tmp/logs/1796.txt", "a");
    if (log)
    {
      fprintf(log, "About to evaluate tls_conn branch: tls_conn=%d\n", (int) tls_conn);
      fclose(log);
    }
  }

  if (tls_conn)
  {
    /* TLS branch */
    {
      FILE *log = fopen("/tmp/logs/1796.txt", "a");
      if (log)
      {
        fprintf(log, "Entered TLS branch (tls_conn==true)\n");
        fclose(log);
      }
    }
#ifdef HTTPS_SUPPORT
    pre_send_setopt (connection, (! tls_conn), push_data);
    ret = gnutls_record_send (connection->tls_session,
                              buffer,
                              buffer_size);
    {
      FILE *log = fopen("/tmp/logs/1796.txt", "a");
      if (log)
      {
        fprintf(log, "gnutls_record_send returned %zd\n", ret);
        fclose(log);
      }
    }
    if (GNUTLS_E_AGAIN == ret)
    {
#ifdef EPOLL_SUPPORT
      connection->epoll_state &=
        ~((enum MHD_EpollState) MHD_EPOLL_STATE_WRITE_READY);
#endif
      FILE *log = fopen("/tmp/logs/1796.txt", "a");
      if (log)
      {
        fprintf(log, "TLS: GNUTLS_E_AGAIN -> returning MHD_ERR_AGAIN_\n");
        fclose(log);
      }
      return MHD_ERR_AGAIN_;
    }
    if (GNUTLS_E_INTERRUPTED == ret)
    {
      FILE *log = fopen("/tmp/logs/1796.txt", "a");
      if (log)
      {
        fprintf(log, "TLS: GNUTLS_E_INTERRUPTED -> returning MHD_ERR_AGAIN_\n");
        fclose(log);
      }
      return MHD_ERR_AGAIN_;
    }
    if ( (GNUTLS_E_ENCRYPTION_FAILED == ret) ||
         (GNUTLS_E_INVALID_SESSION == ret) ||
         (GNUTLS_E_COMPRESSION_FAILED == ret) ||
         (GNUTLS_E_EXPIRED == ret) ||
         (GNUTLS_E_HASH_FAILED == ret) )
    {
      FILE *log = fopen("/tmp/logs/1796.txt", "a");
      if (log)
      {
        fprintf(log, "TLS: GNUTLS fatal error -> returning MHD_ERR_TLS_ (ret=%zd)\n", ret);
        fclose(log);
      }
      return MHD_ERR_TLS_;
    }
    if ( (GNUTLS_E_PUSH_ERROR == ret) ||
         (GNUTLS_E_INTERNAL_ERROR == ret) ||
         (GNUTLS_E_CRYPTODEV_IOCTL_ERROR == ret) ||
         (GNUTLS_E_CRYPTODEV_DEVICE_ERROR == ret) )
    {
      FILE *log = fopen("/tmp/logs/1796.txt", "a");
      if (log)
      {
        fprintf(log, "TLS: GNUTLS E_PIPE-like -> returning MHD_ERR_PIPE_ (ret=%zd)\n", ret);
        fclose(log);
      }
      return MHD_ERR_PIPE_;
    }
#if defined(GNUTLS_E_PREMATURE_TERMINATION)
    if (GNUTLS_E_PREMATURE_TERMINATION == ret)
      return MHD_ERR_CONNRESET_;
#elif defined(GNUTLS_E_UNEXPECTED_PACKET_LENGTH)
    if (GNUTLS_E_UNEXPECTED_PACKET_LENGTH == ret)
      return MHD_ERR_CONNRESET_;
#endif /* GNUTLS_E_UNEXPECTED_PACKET_LENGTH */
    if (GNUTLS_E_MEMORY_ERROR == ret)
      return MHD_ERR_NOMEM_;
    if (ret < 0)
    {
      /* Treat any other error as hard error. */
      FILE *log = fopen("/tmp/logs/1796.txt", "a");
      if (log)
      {
        fprintf(log, "TLS: ret<0 -> returning MHD_ERR_NOTCONN_ (ret=%zd)\n", ret);
        fclose(log);
      }
      return MHD_ERR_NOTCONN_;
    }
#ifdef EPOLL_SUPPORT
    /* Unlike non-TLS connections, do not reset "write-ready" if
     * sent amount smaller than provided amount, as TLS
     * connections may break data into smaller parts for sending. */
#endif /* EPOLL_SUPPORT */
#else  /* ! HTTPS_SUPPORT  */
    /* This assignment is the code that is unreachable when tls_conn is
     * compile-time false. We keep a log here to provide evidence that
     * the TLS branch would have assigned this value if it could run. */
    {
      FILE *log = fopen("/tmp/logs/1796.txt", "a");
      if (log)
      {
        fprintf(log, "TLS support not compiled in: inside TLS branch body (unreachable if tls_conn==false) -> setting ret=MHD_ERR_NOTCONN_\n");
        fclose(log);
      }
    }
    ret = MHD_ERR_NOTCONN_;
#endif /* ! HTTPS_SUPPORT  */
  }
  else
  {
    /* plaintext transmission */
    {
      FILE *log = fopen("/tmp/logs/1796.txt", "a");
      if (log)
      {
        fprintf(log, "Entered plaintext branch (tls_conn==false). buffer_size=%zu, push_data=%d\n",
                buffer_size, (int) push_data);
        fclose(log);
      }
    }

    if (buffer_size > MHD_SCKT_SEND_MAX_SIZE_)
    {
      FILE *log = fopen("/tmp/logs/1796.txt", "a");
      if (log)
      {
        fprintf(log, "Truncating buffer_size to MHD_SCKT_SEND_MAX_SIZE_ and clearing push_data (was %d)\n", (int) push_data);
        fclose(log);
      }

      buffer_size = MHD_SCKT_SEND_MAX_SIZE_; /* send() return value limit */
      push_data = false; /* Incomplete send */
    }

    pre_send_setopt (connection, (! tls_conn), push_data);
#ifdef MHD_USE_MSG_MORE
    ret = MHD_send4_ (s,
                      buffer,
                      buffer_size,
                      push_data ? 0 : MSG_MORE);
#else
    ret = MHD_send4_ (s,
                      buffer,
                      buffer_size,
                      0);
#endif

    {
      FILE *log = fopen("/tmp/logs/1796.txt", "a");
      if (log)
      {
        fprintf(log, "plaintext send returned ret=%zd\n", ret);
        fclose(log);
      }
    }

    if (0 > ret)
    {
      const int err = MHD_socket_get_error_ ();

      {
        FILE *log = fopen("/tmp/logs/1796.txt", "a");
        if (log)
        {
          fprintf(log, "plaintext send error: err=%d -> checking conditions\n", err);
          fclose(log);
        }
      }

      if (MHD_SCKT_ERR_IS_EAGAIN_ (err))
      {
#ifdef EPOLL_SUPPORT
        /* EAGAIN, no longer write-ready */
        connection->epoll_state &=
          ~((enum MHD_EpollState) MHD_EPOLL_STATE_WRITE_READY);
#endif /* EPOLL_SUPPORT */
        FILE *log = fopen("/tmp/logs/1796.txt", "a");
        if (log)
        {
          fprintf(log, "plaintext: EAGAIN -> returning MHD_ERR_AGAIN_\n");
          fclose(log);
        }
        return MHD_ERR_AGAIN_;
      }
      if (MHD_SCKT_ERR_IS_EINTR_ (err))
      {
        FILE *log = fopen("/tmp/logs/1796.txt", "a");
        if (log)
        {
          fprintf(log, "plaintext: EINTR -> returning MHD_ERR_AGAIN_\n");
          fclose(log);
        }
        return MHD_ERR_AGAIN_;
      }
      if (MHD_SCKT_ERR_IS_REMOTE_DISCNN_ (err))
      {
        FILE *log = fopen("/tmp/logs/1796.txt", "a");
        if (log)
        {
          fprintf(log, "plaintext: REMOTE_DISCONN -> returning MHD_ERR_CONNRESET_\n");
          fclose(log);
        }
        return MHD_ERR_CONNRESET_;
      }
      if (MHD_SCKT_ERR_IS_ (err, MHD_SCKT_EPIPE_))
      {
        FILE *log = fopen("/tmp/logs/1796.txt", "a");
        if (log)
        {
          fprintf(log, "plaintext: EPIPE -> returning MHD_ERR_PIPE_\n");
          fclose(log);
        }
        return MHD_ERR_PIPE_;
      }
      if (MHD_SCKT_ERR_IS_ (err, MHD_SCKT_EOPNOTSUPP_))
      {
        FILE *log = fopen("/tmp/logs/1796.txt", "a");
        if (log)
        {
          fprintf(log, "plaintext: EOPNOTSUPP -> returning MHD_ERR_OPNOTSUPP_\n");
          fclose(log);
        }
        return MHD_ERR_OPNOTSUPP_;
      }
      if (MHD_SCKT_ERR_IS_ (err, MHD_SCKT_ENOTCONN_))
      {
        FILE *log = fopen("/tmp/logs/1796.txt", "a");
        if (log)
        {
          fprintf(log, "plaintext: ENOTCONN -> returning MHD_ERR_NOTCONN_\n");
          fclose(log);
        }
        return MHD_ERR_NOTCONN_;
      }
      if (MHD_SCKT_ERR_IS_ (err, MHD_SCKT_EINVAL_))
      {
        FILE *log = fopen("/tmp/logs/1796.txt", "a");
        if (log)
        {
          fprintf(log, "plaintext: EINVAL -> returning MHD_ERR_INVAL_\n");
          fclose(log);
        }
        return MHD_ERR_INVAL_;
      }
      if (MHD_SCKT_ERR_IS_LOW_RESOURCES_ (err))
      {
        FILE *log = fopen("/tmp/logs/1796.txt", "a");
        if (log)
        {
          fprintf(log, "plaintext: LOW_RESOURCES -> returning MHD_ERR_NOMEM_\n");
          fclose(log);
        }
        return MHD_ERR_NOMEM_;
      }
      if (MHD_SCKT_ERR_IS_ (err, MHD_SCKT_EBADF_))
      {
        FILE *log = fopen("/tmp/logs/1796.txt", "a");
        if (log)
        {
          fprintf(log, "plaintext: EBADF -> returning MHD_ERR_BADF_\n");
          fclose(log);
        }
        return MHD_ERR_BADF_;
      }
      /* Treat any other error as a hard error. */
      FILE *log = fopen("/tmp/logs/1796.txt", "a");
      if (log)
      {
        fprintf(log, "plaintext: other error -> returning MHD_ERR_NOTCONN_ (err=%d)\n", err);
        fclose(log);
      }
      return MHD_ERR_NOTCONN_;
    }
#ifdef EPOLL_SUPPORT
    else if (buffer_size > (size_t) ret)
      connection->epoll_state &=
        ~((enum MHD_EpollState) MHD_EPOLL_STATE_WRITE_READY);
#endif /* EPOLL_SUPPORT */
  }

  /* If there is a need to push the data from network buffers
   * call post_send_setopt(). */
  /* If TLS connection is used then next final send() will be
   * without MSG_MORE support. If non-TLS connection is used
   * it's unknown whether sendfile() will be used or not so
   * assume that next call will be the same, like this call. */
  if ( (push_data) &&
       (buffer_size == (size_t) ret) )
  {
    FILE *log = fopen("/tmp/logs/1796.txt", "a");
    if (log)
    {
      fprintf(log, "Calling post_send_setopt: push_data=%d, buffer_size==ret==%zd, tls_conn=%d\n",
              (int) push_data, ret, (int) tls_conn);
      fclose(log);
    }
    post_send_setopt (connection, (! tls_conn), push_data);
  }

  {
    FILE *log = fopen("/tmp/logs/1796.txt", "a");
    if (log)
    {
      fprintf(log, "RETURNING ret=%zd\n", ret);
      fclose(log);
    }
  }

  return ret;
}
